        {
            "image": "https://upload.wikimedia.org/wikipedia/en/5/54/Not_Quite_Human_2_poster.jpg",
            "plot": "The film begins with Chip (Jay Underwood), the android, installing specially-ordered software designed to enhance his facial expressions; it is later discovered that he also inadvertently intakes a computer virus that causes him to malfunction very gradually, diminishing control over his own system's functions. Initially, the virus simply causes Chip to have momentary memory lapses resulting in poor judgment, but within five days it will completely destroy his internal systems, and destroy him. That same day, Dr. Jonas Carson (Alan Thicke) and his daughter, Becky (Robyn Lively), attend Chip's high school graduation. Chip mentions that he wants to attend college and has already signed up for the summer session; however, his father does not feel Chip is ready to be on his own. Becky later manages to persuade her dad to grant Chip's request, pointing out that college is the natural next step in Chip's development.  Since Dr. Carson only reluctantly agreed to allow Chip to attend college, he and Becky secretly follow him to the school in a vehicle that is set up as a monitoring station in order to watch from a distance. At school, Chip sees a girl in a lab coat passing through the hall of the science building and becomes infatuated with her. Chip gets help from his roommate to try to fit in better socially at school, but Chip manages to alienate himself from a popular girl and from his roommate because of his awkwardness.  Symptoms from the virus also hinder his progress.  When Chip feels homesick and calls his dad, his dad advises that he go after something that really interests him. The next day, Chip follows the girl in the lab coat, Roberta (Katie Barberi), into the robotics lab and asks her out on a date, where she informs Chip that she is an android. Excited by this revelation, Chip tells her that he is also an android. Chip soon learns that Roberta is not able to decide anything for herself, so he introduces her to the concept of free will by reprogramming her. When Roberta chooses to go with Chip instead of returning to Dr. Phil Masters (Greg Mullavy) and the other scientists who developed her, the two of them are forced to flee. Prof. Victoria Gray (Dey Young) discovers that her fellow scientists are responsible for distributing a virus designed to disable competitors' androids, so she joins Dr. Carson in trying to catch up with Chip to provide the counter agent.  After being relentlessly pursued a great distance, Chip and Roberta finally manage to escape the scientists, and they are surrounded by desert when Roberta explains that running has used up almost all of her power. With the virus's effects growing more pronounced, Chip is unable to control his body very effectively as he carries Roberta and desperately searches for a power outlet to recharge her. Not finding an adequate power source, Chip slumps to the ground as the virus overtakes him, saying haltingly to Roberta, \"I... love... you\". Dr. Carson and Becky arrive just a moment later with Prof. Gray, and they manage to successfully administer the antidote just before Chip's systems fail completely. Once he is fully revived, Chip reveals that he had utilized his magnetic finger to write all of Roberta's programming and memories to a diskette before she lost all power, preserving the character and personality of the girl that he had fought to protect. A photograph at the end shows the Carsons together with Roberta and Prof. Gray.",
