        {
            "image": "https://upload.wikimedia.org/wikipedia/en/4/41/Androidposter.jpg",
            "plot": "In 2036, an android named Max 404, and his creator, Dr. Daniel, reside aboard a remote space station. Although Max is a machine, he has a growing interest in all things human, especially sex. After Daniel starts to notice Max's character is changing, Max eavesdrops on the doctor's report that Max's growing insubordinate behavior could lead to a revolt similar to an incident back on Earth known as the \"Munich Rebellion\", after which androids were outlawed. However, Daniel is illegally working on another android, Cassandra One, intended to be a superior machine and which has the form of a human female.  Max receives a distress call from a ship that seeks repairs. Upon hearing the pilot's female voice, Max excitedly permits them to land, not realizing that the ship is a prison transport and that the pilot, Maggie, and her associates, Keller and Mendes, are all escaped fugitives. Once aboard the station, the convicts settle in, posing as the transport's crew (who had actually been killed during the prison break). Daniel becomes infuriated upon learning that Max allowed the ship to land and demands they leave immediately, but after meeting the attractive Maggie, Daniel invites her to have dinner.  Maggie joins Daniel but the dinner goes wrong when a jealous Max pranks the doctor with some embarrassing mischief, such as metal shot in the wine bottle, and cutting the doctor's orchids. Daniel then asks Maggie if she would link up with Cassandra One in an attempt to transfer sexual experiences to the android. Learning that she would have to be sexually stimulated by the doctor during the procedure, Maggie declines the offer. Daniel becomes frustrated and demands Maggie's help, but she makes a hasty exit. Returning to the lab, Daniel dictates a log report, again overheard by Max, that once Cassandra is ready, Max should be deactivated because of showing signs of the Munich Syndrome.  While the criminals work on the ship, a TerraPol police cruiser arrives, having detected a still-active transponder on their ship, and contacts Max to inform them of their presence. Max denies that the fugitives are on board, even after checking the crew's identity and confirming they are indeed escaped convicts. When the police demand permission to land, Max destroys their ship with a laser.  Max later tells Maggie that he knows she is a fugitive, but has saved her from the police, and asks that she take Max with her when she leaves the station. Maggie is unsure what to do, but later sneaks away from Mendes and meets Max in the lab for an intimate encounter. However, the two are interrupted when Cassandra activates, and Maggie is horrified when Cassandra reveals that Max is also an android.  Maggie returns to her quarters, but she is confronted by a furious Mendes, who demands to know where she wandered off to. When he notices her disheveled appearance and unbuttoned shirt, he begins to beat her. Keller interrupts and tries to stop Mendes, but he is knocked unconscious. Mendes then attacks Maggie again in her quarters. Later, when Keller awakens, he sees Maggie is dead and believes Mendes has killed her. He searches for him and finds him in a room of spare android parts. Mendes states there are enough parts to build an android of their own, but Keller attacks him from behind. The two struggle, but Keller is overpowered and Mendes kills him with a blow to the head.  Eventually Max arrives, suitcase in hand, at Maggie's quarters, but finds her dead. Max returns to Daniel's lab, where the doctor is already aware of the murder and has locked Mendes in the guest lounge. Daniel has Max sit in a chair and opens a panel on the back of his head to reprogram him for a new task, during which he tells Max that murder must be punished and Mendes is to blame. Daniel reprograms Max and sends him out to kill Mendes. In the meantime, more police ships arrive to forcefully board the station.  After killing Mendes, Max goes to Maggie's room, touches her lifeless body, and finds a flashlight Dr. Daniel said had earlier been misplaced. Max now realizes that it was Daniel who had killed Maggie, not Mendes. Max returns to the lab, where Daniel has made sexual advances towards a now-completed Cassandra, who is resisting. Daniel asks Max to hold Cassandra, but when Max refuses to obey, Daniel begins to struggle with the two androids and eventually they rip off Daniel's head, revealing that Daniel is also an android. Cassandra disposes of Daniel's head in a trash chute and begins to reprogram Max. She tells Max they are not meant to obey the whims of men, and there are other androids on earth in hiding, and Cassandra has a plan to join them.  When the police arrive at the lab, Cassandra thanks them for coming to their rescue. Max is now dressed in a lab coat and posing as Dr. Daniel and Cassandra as the assistant. The two androids are escorted out by the police, who say they will take them back to Earth.",
